create table shopping_list_items
(
    id               int auto_increment
        primary key,
    shopping_list_id varchar(255) null,
    item_id          int          null,
    quantity         int          null,
    constraint shopping_list_items_inventory_item_id_fk
        foreign key (item_id) references inventory_item (id),
    constraint shopping_list_items_shopping_list_list_id_fk
        foreign key (shopping_list_id) references shopping_list (list_id)
);

